import React from 'react';

const colSpanClasses = {
  1: 'md:col-span-1',
  2: 'md:col-span-2',
  3: 'md:col-span-3',
  4: 'md:col-span-4',
  5: 'md:col-span-5',
  6: 'md:col-span-6',
};

function ArchivioCard({ col, url, desc }) {
  const colSpanClass = colSpanClasses[col] || 'md:col-span-1';
  return (
    <div className={`col-span-full ${colSpanClass} flex flex-col gap-2 justify-start items-start`}>
      <img src={url} className='aspect-square object-cover' alt="Archivio"/>
      <h3 className='w-full text-start uppercase text-xs'>{desc}</h3>
    </div>
  );
}

export default ArchivioCard;
